  false,\n\t\"url\": null,\n\t\"notes\": \"Key ecological processes were restored
  with saltwater influence to formerly diked areas. These processes include tidal
  hydrology, cycling of organic matter and nutrients, and sediment movements. New
  off-channel habitat was made available to fish. Plant communities will recolonize
  and grow making organic matter and prey items available. An increase in the quantity
  and quality of foraging habitat for waterbirds and shorebirds will also occur. Pre-restoration
  baseline data characterizing channel morphology, sediments, general site conditions
  (using aerial and oblique photographs), tidal range, and vegetation were collected
  for comparison with historic data on avian, fish, and invertebrate occurrence. Post-restoration
  monitoring will evaluate the implemented management actions and, in turn, will guide
  future ones to achieve desired habitat conditions. Pre- and post-restoration monitoring
  will provide valuable information for similar habitat restoration projects in the
  future.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
